	add("angiosperm", "{\"term\":\"angiosperm\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027ἀγγεῖον\u0027 (receptacle) + \u0027σπέρμα\u0027 (seed)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any plant of the clade Angiosperms, characterized by having ovules enclosed in an ovary; a flowering plant\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"As with the Lejeuneaceae, this pattern of massive speciation appears to be correlated with the Cretaceous explosion of the \u0027\u0027angiosperms\u0027\u0027 and the simultaneous creation of a host of new microenvironments, differing in humidity, light intensity, texture, etc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1997\u0027\u0027, Valentin A. Krassilov, \u0027Angiosperm Origins: Morphological and Ecological Aspects\u0027, [http://books.google.com.au/books?id\u003dlXzlpRw_y38C\u0026amp;pg\u003dPA134\u0026amp;dq\u003d%22angiosperm%22%7C%22angiosperms%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003ddt39UuSEBMSVkwXUsICgCQ\u0026amp;redir_esc\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22angiosperm%22%7C%22angiosperms%22\u0026amp;f\u003dfalse page 134\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The notion of magnoliaceans as the most primitive living \u0027\u0027angiosperms\u0027\u0027, justified or not, does not mean that all their characters, including multilacunar nodal anatomy and the lack of tannins, are primary\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Xin Wang, \u00273: New Fossils and New Hope for the Origin of Angiosperms\u0027, Pierre Pontarotti, \u0027Evolutionary Biology: Concept, Modeling, and Application\u0027, [http://books.google.com.au/books?id\u003dvl2COz8Sq1EC\u0026amp;pg\u003dPA55\u0026amp;dq\u003d%22angiosperm%22%7C%22angiosperms%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003ddt39UuSEBMSVkwXUsICgCQ\u0026amp;redir_esc\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22angiosperm%22%7C%22angiosperms%22\u0026amp;f\u003dfalse page 55\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"With all these features, it is pretty easy for one to identify an \u0027\u0027angiosperm\u0027\u0027. This is a very normal and common practice for neobotanists. However, the situation becomes complicated when you go back to the early history of \u0027\u0027angiosperms\", \"priority\":8}]}, \"synonyms\":{}}");

	add("angle", "{\"term\":\"angle\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Mostly derived from the toponym \u0027Angle\u0027, from Appendix:Proto-Germanic/anguz|*anguz \u0026quot;narrow, tight; tapering, angular\u0026quot;, either indicating the \u0026quot;narrow\u0026quot; water (i.e. the Schlei estuary), or the \u0026quot;angular\u0026quot; shape of the peninsula.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A member of a Germanic tribe first mentioned by Tacitus, one of several which invaded Britain and merged to become the Anglo-Saxons\", \"priority\":1}]}, \"synonyms\":{}}");

