	add("anguish", "{\"term\":\"anguish\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\", \"anglo-norman\"], \"text\":\"Middle english (1100-1500) \u0027lang\u003denm\u0027 \u0027lang\u003denm\u0027 from Anglo-norman \u0027lang\u003dfro\u0027 \u0027anguisse\u0027 from Old french (842-ca. 1400) \u0027lang\u003dfro\u0027 from Latin \u0027angustia\u0027 (narrowness, difficulty, distress) from \u0027angustus\u0027 () from \u0027angere\u0027 () See \u0027angst\u0027 the Germanic cognate, and \u0027anger\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Extreme pain, either of body or mind; excruciating distress\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Bible, Exodus vi\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"But they hearkened not unto Moses for \u0027\u0027anguish\u0027\u0027 of spirit, and for cruel bondage\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Latime\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Ye miserable people, you must go to God in \u0027\u0027anguishes\u0027\u0027, and make your prayer to him\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1889\u0027\u0027,w:Sir Arthur Conan Sir Arthur Conan Doyle, \u0027s:The Hound of the Baskervilles/Chapter The Hound of the Baskervilles\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A terrible scream—a prolonged yell of horror and \u0027\u0027anguish\u0027\u0027—burst out of the silence of the moor. That frightful cry turned the blood to ice in my veins\", \"priority\":7}]}, \"synonyms\":{}}");

